import React from "react";
import "./App.css";

function App() {
  return (
  <section className="section-main">
    <form className="submit-form">
      <h2>My List</h2>
      <input type="text" />
      <button type="submit" className="submit-btn">Submit</button>
    </form>
  </section>
  )
}

export default App;
